function appHeight() {
	const doc = document.documentElement
	doc.style.setProperty('--vh', (window.innerHeight*.01) + 'px');
}

function afterCloseHeaderTransfer() {
	$('#amount_header').val('');
	if (document.getElementById('form_transfer_wallet_header') != undefined) {
		$('#form_transfer_wallet_header').validate().resetForm();
	}
}

function selectItem(val, idInput, from='') {
	// update hidden input
	$('#' + idInput).val(val);
	// update toggle select
	const itemSelected = makeItem(val);
	$('#' + idInput + '_selected').html(itemSelected);
	// remove item in to wallet
	let isFirst = true;
	if (from) {
		['main', 'techplay', 'game'].forEach(item => {
			const pathToItem = '#to_wallet_' + from + ' .item_' + item;
			if (val === item) {
				$(pathToItem).addClass('disabled');
			} else {
				$(pathToItem).removeClass('disabled');
				if (isFirst) {
					selectItem(item, 'to_wallet_input_' + from);// selectItem('main', 'to_wallet_input_header')
					isFirst = false;
				}
			}
		});
	}
}

function makeItem(val) {
	let icon = '';
	let text = '';
	switch(val) {
		case 'main':
			icon = '<img src="assets/images/icons/wallet/main.svg" alt="">';
			text = '<span>V Chnh</span>';
			break;
		case 'techplay':
			icon = '<img src="assets/images/icons/wallet/tp.svg" alt="">';
			text = '<span>V TP</span>';
			break;
		case 'game':
			icon = '<img src="assets/images/icons/wallet/gb.svg" alt="">';
			text = '<span>V Game Bi</span>';
			break;
	}
	return icon + text;
}
